INSERT INTO `GNAV_SURVEY_DATA_LT` VALUES ('0e2177be01ece15e1597155eb81fef70','Bangladesh Integrated Household Survey (BIHS) 2011-2012 is the only nationally representative survey that has collected data on (1) plot-level agricultural production and practices, (2) dietary intake of individual household members, and (3) anthropometric measurements of all household members.The BIHS covers 6500 households in 325 primary sampling units. The sample is statistically representative at following levels: (a) nationally representative of rural Bangla  desh; (b) representative of rural areas of each of the seven administrative divisions of the country: Barisal, Chittagong, Dhaka, Khulna, Rajshahi, Rangpur, and Sylhet; and (c) representative of the Feed the Future (FTF) zone of influence.'),('2db28096ed620b8705db9293f8f745cd','The Ethiopia Rural Household Survey (ERHS) is a unique longitudinal household data set covering households in a number of villages in rural Ethiopia. Data collection started in 1989, when a team visited 6 farming villages in Central and Southern Ethiopia. In 1989, IFPRI conducted a survey in seven Peasant Associations located in the regions Amhara, Oromiya and the Southern Ethiopian Peopleu2019s Association (SNNPR). Civil conflict prevented survey work from being undertaken in Tigray. Under extremely difficult field conditions, household data were collected in order to study the response of households to food crises. The study collected consumption, asset and income data on about 450 households. In 1994, the survey was expanded to cover 15 villages across the country. An additional round was conducted in late 1994, with further rounds in 1995, 1997, 1999, 2004, and 2009. In addition, nine new villages were selected giving a sample of 1477 households. The nine additional communities were selected to account for the diversity in the farming systems in the country, including the grain-plough areas of the Northern and Central highlands, the enset-growing areas and the sorghum-hoe areas. Topics addressed in the survey include household characteristics, agriculture and livestock information, food consumption, health, womenu2019s activities, as well as community level data on electricity and water, sewage and toilet facilities, health services, education, NGO activity, migration, wages, and production and marketing.'),('39b0825e3d1e594a2129dbb03db72ac7','Identifying socioeconomic constraints to and incentives for faster technology adoption: Pathways to sustainable intensification in eastern and southern Africa aims to better understand how smallholders make decisions about their farming practices, particularly adopting new technologies or practices. The project, more commonly dubbed as the Adoption Pathways project investigates how smallholder decisions are influenced by socioeconomic factors (including gender dynamics, labour availability and the availability of credit), changes in farming systems (changes in crop and livestock patterns and practices), and external factors (such as climate variability, markets and policies). The Adoption Pathways project builds on the SIMLESA program and provides an evidence-based understanding of the incentives and barriers to adoption for smallholder farmers. Over the medium to long term, benefits include developing knowledge and understanding of the underlying forces of adoption, identification of drivers (both accelerators and impediments) of change, tools and methods for analysing impact of new technologies, and practical and actionable policy recommendations for improving the adoption of new technologies. This project builds on an earlier scoping study (Sustainable agricultural intensification pathways for improving food security in maize systems in Africa: Socioeconomic dynamics, drivers of change and policy options for inclusive growth) which aimed to bring together key project partners and stakeholders for consultation to design the Adoption Pathways project.'),('800a68c647019c6de1cf4378dc26cb44','The GHS survey is a cross-sectional survey of 22,000 households carried out annually throughout the country. The panel component (GHS-Panel) applies to 5,000 households of the GHS collecting additional data on multiple agricultural activities and on household consumption. As the focus of this panel component is to improve data from the agricultural sector and link this to other facets of household behavior and characteristics, the GHS-Panel drew heavily on the Harmonized National Living Standards Survey (HNLSS  a multi-topic household survey) and the National Agricultural Sample Survey (NASS  the key agricultural survey) to create a new survey instrument to shed light on the role of agriculture in households economic wellbeing that can be monitored over time.'),('80667e662891ecdb20fdf3109cbd5287','The Womens Empowerment in Agriculture Index (WEAI), launched by IFPRI, Oxford Poverty and Human Development Initiative (OPHI), and USAID\'s Feed the Future in February 2012, is the first comprehensive and standardized measure to directly capture womens empowerment and inclusion levels in the agricultural sector.  The WEAI is an innovative tool composed of two sub-indexes: one measures how empowered women are within five domains, and the other measures gender parity in empowerment within the household. '),('8fa5af58c815c20c06a98f90afe0ed29','Suaahara is an integrated nutrition program in Nepal that uses a comprehensive, household-based approach to improve access to, and consumption of, nutritious foods in areas with very poor nutrition indicators. Its main objective is to improve the nutritional status of pregnant and lactating women and children under two years of age directly addressing the vulnerable points of development which result in stunting. The program will focus on improving nutrition; maternal, newborn, and child health (MNCH) services; family planning services; water, sanitation and hygiene; and home-based gardening. Behavior change communications and continued support for micronutrient supplementation will be key components of Suaaharas strategy. The program will also work with health facilities to improve nutritional counseling and care services and connect families to reproductive health and MNCH services. One of the distinguishing elements of Suaahara is the integration of various sectorsincluding agricultureto achieve improved nutrition for vulnerable populations.'),('c541d1a60ce2ec4efcfd5da61a8b8de2','The purpose of this survey is to gather gender-disaggregated data on agricultural activities, decision-making, weather information, risk-perception and values from rural households in Kenya, Bangladesh, Uganda and Senegal. The survey ultimately will cover 200 households in each site - the same households that were sampled for the IMPACT Lite Surveys.  This survey builds on the information collected in that round, supplementing the detailed productivity related information with data on decision-making and other topics.  This information will be used for researchers, policy-makers and development practitioners to better understand the vulnerabilities of men and women to climate change, how they differ, and what actions can be taken to reduce that vulnerability.'),('d63c1cac6202087615cddb8fc4b0c9f8','The ECVM/A is an integrated multi-topic household survey done for the purpose of evaluating poverty and living conditions in Niger.  Niger is part of the Living Standards Measurement Study  Integrated Surveys on Agriculture (LSMSISA) program. This program has developed a household level survey a view to enhancing our knowledge of agriculture in Sub-Saharan Africa, in particular, its role in poverty reduction and the techniques for promoting efficiency and innovation in this sector. To achieve this objective, an innovative model for agricultural data collection in this region will need to be developed and implemented. To this end, activities conducted in the future will be supported by four main pillars  a multisectoral framework, institutional integration, analytical capacity building, and active dissemination'),('e5642822472609423cea2a765281c91f','The Ethiopian Rural Socioeconomic Survey (ERSS) is a collaborative project between the Central Statistics Agency of Ethiopia (CSA) and the World Bank Living Standards Measurement Study- Integrated Surveys of Agriculture (LSMS-ISA) team. The objective of the LSMS-ISA is to collect multi-topic panel household level data with a special focus on improving agriculture statistics and the link between agriculture and other household income activities. The idea of the ERSS is rooted in the need to develop and implement a multi-topic survey that meets Ethiopias data demands and gaps, is of high quality, accessible to the public, and aligned with the National Strategy for the Development of Statistics (NSDS). The project also aims to build capacity, share knowledge across countries, and improve survey methodologies and technology. In implementing the ERSS, the CSA has established a framework to facilitate consultations with national and international organizations that would provide technical guidance and later utilize the data for policy decision-making and research purposes. These institutions include the Ministry of Agriculture (MOA), Ministry of Finance and Economic Development (MOFED), Agricultural Transformation Agency, World Food Program (WFP), International Food Policy Research Institute (IFPRI), and Ethiopia Institute of Agricultural Research (EIAR). '),('ee02b55fc36db7e8a3344c5a9bb6b575','The 2010/2011 Tanzania National Panel Survey (TZNPS) is the second in a series of nationally representative household panel surveys that collect information on a wide range of topics including agricultural production, non-farm income generating activities, consumption expenditures, and a wealth of other socio-economic characteristics. Both the first and second rounds of the TZNPS were implemented by the Tanzania National Bureau of Statistics (NBS).'),('f1c8cd650bcfd98fdcd50460b18d9993','The FTF programme started in Ghana in mid-2011 and is being implemented in the three northernmost regions of Ghana namely: Upper West, Upper East, and Northern Region, as well as some selected areas in Brong Ahafo Region that lie above the 8th degree parallel. These areas are designated as the FTF Zone of Influence (FTF ZOI). USAID/Ghana\'s focus on these areas is based on national estimates that indicate that the incidence of poverty, malnutrition, and stunting among children less than five years of age is disproportionately high in these areas. Therefore, by focusing on these areas, the programme seeks to have greater impact than could be anticipated if the programme was thinly spread throughout the country.  The overall objective of the survey is to provide baseline data on the prevalence of poverty, per capita xpenditures, nutritional status, women\'s empowerment, household hunger, dietary diversity and infant and young child feeding behaviours.');
